import React from "react";
import './WebsiteHeader.css'

import { motion } from 'framer-motion';

const WebsiteHeader = () => {
    return (
        <motion.div
            className="header"
            initial={{ opacity: 0, position:"absolute",left:500}}
            animate={{ opacity: 1 }}
            transition={{ duration: 5  }}

        >
            Content to fade in
        </motion.div>
    );
};

export default WebsiteHeader
